shaders.vertex:
attribute vec4 aVertex;
attribute vec4 aTexCoord;
varying vec4 vTexCoord;

void main(void)
{
    vTexCoord = aTexCoord;
    gl_Position = aVertex;
}

shaders.fragment:
// blur chroma fragment shader
// original idea: https://www.shadertoy.com/view/XssGz8

varying vec4 vTexCoord;
uniform sampler2D uTexture;
uniform float uT;
uniform vec2 uResolution;
uniform vec2 uMouse;

uniform float uAmp; // 1.0, 200.0, 2.0

void main()
{	
  vec2 center = uMouse / uResolution;
	vec2 uv = vTexCoord.st;
  vec2 dist = (uv - center) / uAmp;
  vec2 rShift = dist;
  vec2 gShift = dist * vec2(-1.0, -1.0);
  vec2 bShift = vec2(0.0, 0.0);
  float r = texture2D(uTexture, uv - rShift).r;
  float g = texture2D(uTexture, uv - gShift).g;
  float b = texture2D(uTexture, uv - bShift).b;
 	gl_FragColor = vec4(r, g, b, 1.0);
}
